/* Lib */
import cx from 'classnames';

/* Components */
import Dropdown from './components/dropdown';

const Index = () => {

    let list = [1, 2, 3, 4]
    
    let sim = [
        {
            value: 1,
            description: 'Euclidean'
        },
        {
            value: 2,
            description: 'Pearson Colleration'
        }
    ];

    return (
        <div className={cx(['container'], ['m-5'])}>
            <div className={cx(['row'])}>
                <div className={cx(['col-sm'])}>
                    <Dropdown defaultText={'Select user'} list={list} />
                </div>
                <div className={cx(['col-sm'])}>
                    <Dropdown defaultText={'Select similarity'} list={sim} />
                </div>
            </div>
        </div>
    )
};

export default Index;
